Why use a blank @Document for MongoDB domain objects?<p>I have seen a lot of code defining domain objects for MongoDB in the following fashion:</p>
<p>with a blank @Document annotation:</p>
<pre><code>@Document
class Customer {
 int id;
 String name;
}
</code></pre>
<p>without the <code>@Document</code> annotation:</p>
<pre><code>class Customer {
 int id;
 String name;
}
</code></pre>
<p>with a collection name:</p>
<pre><code>@Document(collection = &quot;cust&quot;)
class Customer {
 int id;
 String name;
}
</code></pre>
<p>I can understand the last two, <strong>but why would you want to keep just the <code>@Document</code> annotation ?</strong></p>

