How to resolve TLS version issue with MongoDB cluster in java Spring Boot web project?<p>I am building a Spring Boot web application that uses MongoDB as a data store. I am communicating directly to the live cluster (not a local cluster) using a MongoDB URI. I am using Java 11 (AdoptOpenJDK 11.0.5).</p>
<p>On application startup, my application is unable to communicate to MongoDB cluster due to what looks like a TLS/SSL error:</p>
<pre><code>com.mongodb.MongoSocketWriteException: Exception sending message
        at com.mongodb.internal.connection.InternalStreamConnection.translateWriteException(InternalStreamConnection.java:551) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.InternalStreamConnection.sendMessage(InternalStreamConnection.java:433) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.InternalStreamConnection.sendCommandMessage(InternalStreamConnection.java:273) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.InternalStreamConnection.sendAndReceive(InternalStreamConnection.java:257) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.CommandHelper.sendAndReceive(CommandHelper.java:83) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.CommandHelper.executeCommand(CommandHelper.java:33) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.InternalStreamConnectionInitializer.initializeConnectionDescription(InternalStreamConnectionInitializer.java:105) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.InternalStreamConnectionInitializer.initialize(InternalStreamConnectionInitializer.java:62) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.InternalStreamConnection.open(InternalStreamConnection.java:129) ~[mongodb-driver-core-3.11.2.jar:na]
        at com.mongodb.internal.connection.DefaultServerMonitor$ServerMonitorRunnable.run(DefaultServerMonitor.java:117) ~[mongodb-driver-core-3.11.2.jar:na]
        at java.base/java.lang.Thread.run(Thread.java:834) ~[na:na]
Caused by: javax.net.ssl.SSLHandshakeException: extension (5) should not be presented in certificate_request
        at java.base/sun.security.ssl.Alert.createSSLException(Alert.java:131) ~[na:na]
        at java.base/sun.security.ssl.Alert.createSSLException(Alert.java:117) ~[na:na]
        at java.base/sun.security.ssl.TransportContext.fatal(TransportContext.java:307) ~[na:na]
        at java.base/sun.security.ssl.TransportContext.fatal(TransportContext.java:263) ~[na:na
</code></pre>
<p>According to sources on MongoDB's <a href="https://mongodb.github.io/mongo-java-driver/4.1/driver/tutorials/ssl/" rel="nofollow noreferrer">driver website</a>, they explain that this is a known issue with Java 11. I believe the issue to be <a href="https://bugs.openjdk.java.net/browse/JDK-8236039" rel="nofollow noreferrer">this bug</a> filed with OpenJDK, where it notes an issue with the implementation of SSL connections for TLS 1.3. This provides me with two options:</p>
<ol>
<li>Upgrade to a version of Java that has fixed this.</li>
<li>Set the <code>jdk.tls.client.protocols</code> system property value to <code>TLSv1.2</code>.</li>
</ol>
<p>I have been able to verify that this issue does <em>not</em> resolve when upgrading to Java 15; the error remains <em>identical</em>. I double checked that I was actually using Java 15 before cleaning and rerunning the application with <code>mvn spring-boot:run</code>.</p>
<p>That leaves me with the second option, which brings me to my question:</p>
<h3>How do I correctly set <code>jdk.tls.client.protocols</code> system property when building with Maven?</h3>
<p>I've tried running the application with <code>mvn spring-boot:run -Djdk.tls.client.protocols=TLSv1.2</code> but that still gives the same error as before.</p>
<p>I've provided my <code>pom.xml</code> below; I have <strong>zero</strong> files/code pertaining to MongoDB auto setup in the project, which you can examine in it's entirety <a href="https://github.com/ucsb-cs156-f20/proj-mapache-search/tree/2b4eab2b0d72d27dfbe710adeab79e3771e68567" rel="nofollow noreferrer">here</a>.</p>
