Last value by type with _id relation<p>I have a collection of Event containing a <code>type</code> that can be <code>0</code>, <code>1</code>, <code>2</code>, <code>3</code>, <code>4</code>, <code>5</code> and a <code>createdAt</code> date. Each event is related to an other collection called RTS.</p>
<p>I want to gather for each Rts, the last event of each type.</p>
<p><strong>Problem using my soluce :</strong></p>
<p>The problem is, I have to describe each <code>types</code> one by one in order to make it work. Is there any solution to have dynamical key creation induced by the <code>type</code> value ?</p>
<p><strong>Here is what I get now :</strong></p>
<ol>
<li>I sort the data</li>
<li>Group by <code>idRTS</code> whch contains the link to the second collection. For each type, push the values inside of a specific array.</li>
<li>Remove the null values from the types arrays.</li>
<li>Keep the first value only <code>(the most updated)</code>.</li>
<li>Makes the data presentable.</li>
</ol>
<hr />
<pre><code>[
  {
    $sort: {
      idRTS: -1,
      createdAt: -1
    }
  },
  {
    $group: {
      _id: '$idRTS',
      type0: {
        $push: {
          $cond: {
            if: {
              $eq: [
                '$type', 0
              ]
            },
            then: '$$ROOT',
            else: null
          }
        }
      },
      type5: {
        $push: {
          $cond: {
            if: {
              $eq: [
                '$type', 5
              ]
            },
            then: '$$ROOT',
            else: null
          }
        }
      }
    }
  },
  {
    $project: {
      _id: '$_id',
      type0: {
        '$filter': {
          'input': '$type0',
          'as': 'd',
          'cond': {
            '$ne': [
              '$$d', null
            ]
          }
        }
      },
      type5: {
        $filter: {
          input: '$type5',
          as: 'd',
          cond: {
            $ne: [
              '$$d', null
            ]
          }
        }
      }
    }
  },
  {
    $project: {
      _id: '$_id',
      type0: {
        $arrayElemAt: [
          '$type0', 0
        ]
      },
      type5: {
        '$arrayElemAt': [
          '$type5', 0
        ]
      }
    }
  }
]
</code></pre>

